function getStats(valor){
	//
	var vPS, vAtaque, vDefensa, vAtaqueEspecial, vDefensaEspecial, vVelocidad;
	for(var i = 0; i < stats.length; i++){
		//
		if(i == valor){
			//if(i == 709) console.log(i+1);
			if(stats[i].valores.length > 1){
				//
				for(var j = 0; j < stats[i].valores.length; j++){
					//
					//if(arguments[1] !== undefined) console.log("Segundo");
					if(arguments[1] == stats[i].valores[j].cod){
						//
						vPS = stats[i].valores[j].ps;
						vAtaque = stats[i].valores[j].ataque;
						vDefensa = stats[i].valores[j].defensa;
						vAtaqueEspecial = stats[i].valores[j].ataqueEspecial;
						vDefensaEspecial = stats[i].valores[j].defensaEspecial;
						vVelocidad = stats[i].valores[j].velocidad;
						break;
					}else if(arguments[1] === undefined){
						vPS = stats[i].valores[j].ps;
						vAtaque = stats[i].valores[j].ataque;
						vDefensa = stats[i].valores[j].defensa;
						vAtaqueEspecial = stats[i].valores[j].ataqueEspecial;
						vDefensaEspecial = stats[i].valores[j].defensaEspecial;
						vVelocidad = stats[i].valores[j].velocidad;
						break;
					}
				}
			}else{
				vPS = stats[i].valores[0].ps;
				vAtaque = stats[i].valores[0].ataque;
				vDefensa = stats[i].valores[0].defensa;
				vAtaqueEspecial = stats[i].valores[0].ataqueEspecial;
				vDefensaEspecial = stats[i].valores[0].defensaEspecial;
				vVelocidad = stats[i].valores[0].velocidad;
			}
			//
			//console.log(stats[i].valores[0].ataque);
			//vPS = stats[i].valores[0].ps;
			//vAtaque = stats[i].valores[0].ataque;
			//vDefensa = stats[i].valores[0].defensa;
			//vAtaqueEspecial = stats[i].valores[0].ataqueEspecial;
			//vDefensaEspecial = stats[i].valores[0].defensaEspecial;
			//vVelocidad = stats[i].valores[0].velocidad;
			break;
		}
	}

	return{
		ps: vPS,
		ataque: vAtaque,
		defensa: vDefensa,
		ataqueEspecial: vAtaqueEspecial,
		defensaEspecial: vDefensaEspecial,
		velocidad: vVelocidad
	};
}








function getStatsMega(valor){
	var vPS, vAtaque, vDefensa, vAtaqueEspecial, vDefensaEspecial, vVelocidad;

	for(var i = 0; i < stats.length; i++){
		if(i == valor && stats[i].valoresPri !== undefined){
			return{
				ps: stats[i].valoresPri[0].ps,
				ataque: stats[i].valoresPri[0].ataque,
				defensa: stats[i].valoresPri[0].defensa,
				ataqueEspecial: stats[i].valoresPri[0].ataqueEspecial,
				defensaEspecial: stats[i].valoresPri[0].defensaEspecial,
				velocidad: stats[i].valoresPri[0].velocidad
			};
		}
		if(i == valor && stats[i].valoresMega !== undefined){
			if (stats[i].valoresMega.length > 1) {
				for(var j = 0; j < stats[i].valoresMega.length; j++){
					if(arguments[1] == stats[i].valoresMega[j].cod){
						vPS = stats[i].valoresMega[j].ps;
						vAtaque = stats[i].valoresMega[j].ataque;
						vDefensa = stats[i].valoresMega[j].defensa;
						vAtaqueEspecial = stats[i].valoresMega[j].ataqueEspecial;
						vDefensaEspecial = stats[i].valoresMega[j].defensaEspecial;
						vVelocidad = stats[i].valoresMega[j].velocidad;
						break;
					}
				}
			}else{
				vPS = stats[i].valoresMega[0].ps;
				vAtaque = stats[i].valoresMega[0].ataque;
				vDefensa = stats[i].valoresMega[0].defensa;
				vAtaqueEspecial = stats[i].valoresMega[0].ataqueEspecial;
				vDefensaEspecial = stats[i].valoresMega[0].defensaEspecial;
				vVelocidad = stats[i].valoresMega[0].velocidad;
			}
			return{
				ps: vPS,
				ataque: vAtaque,
				defensa: vDefensa,
				ataqueEspecial: vAtaqueEspecial,
				defensaEspecial: vDefensaEspecial,
				velocidad: vVelocidad
			};
		}
	}
}













